import React from "react";

const Login = () => {
  return (
    <div className="login">
      <form className="loginFrom">
        <h1>Login Here</h1>
        <input type="name" placeholder="username" />
        <input type="password" placeholder="password" />
      </form>
    </div>
  );
};

export default Login;
